import React from "react";

function ClientInfo() {
  return (
    <form style={{ width: "30%" }}>
      <div class="form-group">
        <label for="exampleFormControlInput1">First name</label>
        <input
          type="text"
          class="form-control"
          id="exampleFormControlInput1"
          placeholder="First Name"
        />
      </div>
    </form>
  );
}

export default ClientInfo;
